import React from "react";
import "./weekData.css";

function WeekData({ data }) {
  console.log(data);
  return (
    <div>
      <p>week information</p>
      <p>{data.weekStartDate}</p>
      <p> to </p>
      <p>{data.weekEndDate}</p>
    </div>
  );
}

export default WeekData;
